package forCase;

public class tableOF1to20 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int j=1;j<=10;j++) {
			int tableOf=j;                                    //TABLE...
			for(int i=1;i<=10;i++) {
				System.out.print(tableOf *i+"       ");
			}
			System.out.println();
			
		}

	}

}
